sympy.sympy.polys.densebasic.dmp_strip:
def dmp_strip(f: dmp[Er], u: int, K: Domain[Er] | None = None) -> dmp[Er]:
    """
    Remove leading zeros from ``f`` in ``K[X]``.

    Examples
    ========

    >>> from sympy.polys.densebasic import dmp_strip

    >>> dmp_strip([[], [0, 1, 2], [1]], 1)
    [[0, 1, 2], [1]]

    """
    if not u:
        return _dmp(dup_strip(_dup(f), K))

    if dmp_zero_p(f, u):
        return f

    i, v = 0, u - 1

    for c in f:
        if not dmp_zero_p(c, v):
            break
        else:
            i += 1

    if i == len(f):
        return dmp_zero(u, K)
    else:
        return f[i:]

sympy.sympy.polys.densetools._rec_eval_t:
def _rec_eval_tail(g: dmp[Er], i: int, A: list[Er], u: int, K: Domain[Er]) -> dmp[Er]:
    """Recursive helper for :func:`dmp_eval_tail`."""
    if i == u:
        return _ground_dmp(dup_eval(_dup(g), A[-1], K))
    else:
        h = [ _rec_eval_tail(c, i + 1, A, u, K) for c in g ]

        if i < u - len(A) + 1:
            return h
        else:
            return _ground_dmp(dup_eval(_dup(h), A[-u + i - 1], K))
